import React, { Component } from 'react';
import { connect } from 'react-redux';
import moment from 'moment';
import {
    Form,
    Input,
    Tooltip,
    Icon,
    Cascader,
    Select,
    Row,
    Col,
    Checkbox,
    Button,
    AutoComplete,
    DatePicker ,
    Switch,
    Radio ,
    Table
  } from 'antd';
import TextArea from 'antd/lib/input/TextArea';
import DependentsSubForm from './DependentsSubForm';
import TrustSubForm from './TrustSubForm';
import CorporateSubForm from './CorporateSubForm';
import CharitySubForm from './CharitySubForm';
import OtherFinancialSubForm from './OtherFinancialSubForm';
import ProfessionalContactSubForm from './ProfessionalContactSubForm';
import PhoneNumber from '../../../../components/form/PhoneNumber';
import Email from '../../../../components/form/Email';


const { Option } = Select;
const { MonthPicker, RangePicker } = DatePicker;

const dateFormatList = ['DD/MM/YYYY', 'DD/MM/YY'];
const dateFormat = 'MM/DD/YYYY';
const monthFormat = 'YYYY/MM';


class ClientFormWrap extends Component {

    constructor(props) {
        super(props);

        this.state = {
            forms: {
                client: {
                    // id:
                    firstName: 'String!',
                    lastName: 'String!',
                    birthdate: 'String!',
                    estimatedDeathAge: 20, //'Int!',
                    primaryContactNumber: 'String',
                    secondaryContactNumber: 'String',
                    workContactNumber: 'String',
                    emailAddress: 'String',
                    secondaryEmailAddress: 'String',
                    gender: 'String',
                    investmentKnowledge: 'String',
                    retirementDate: 'String!'
                },
                address: {
                    // id: String
                    firstLine: 'String!',
                    secondLine: 'String',
                    city: 'String!',
                    state: 'String!',
                    country: 'String!',
                    postalCode: 'String'
                },
                spouse: {
                    // id: String
                    firstName: 'String!',
                    lastName: 'String!',
                    birthdate: 'String',
                    estimatedDeathAge: 20, //'Int',
                    primaryContactNumber: 'String',
                    secondaryContactNumber: 'String',
                    workContactNumber: 'String',
                    emailAddress: 'String',
                    secondaryEmailAddress: 'String',
                    gender: 'String',
                    investmentKnowledge: 'String',
                    retirementDate: 'String',
                    partner: false, //'Boolean'
                },
                dependents: [
                    {
                        // id: String
                        firstName: 'String!',
                        lastName: 'String!',
                        birthdate: 'String!',
                        relationship: 'String!',
                        childTaxCreditEndAt: 'String',
